import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { CommonService } from '../../../services/common/common.service';
import * as pdfMake from 'pdfmake/build/pdfmake.js';
import * as pdfFonts from 'pdfmake/build/vfs_fonts.js';
import { NetworkService } from '../../../services/network/network.service';

@Component({
  selector: 'app-certificate',
  templateUrl: './certificate.component.html',
  styleUrls: ['./certificate.component.scss']
})
export class CertificateComponent implements OnInit {
  explorerURL='https://explorer.theotherfruit.io/chain/transaction/';
  public docDefinition: any;
  NFT: any;
  constructor(
    private common: CommonService,
    private router: Router,
    private networkService: NetworkService
  ) { }

  ngOnInit(): void {
    if (!this.common.NFT) {
      this.router.navigate(['/nft/list']);
    } else {
      this.NFT = this.common.NFT;
    }
    console.log('>>>>>', this.NFT)
  }

  async openLinkInBrowser(link) {
    if (link===undefined || link===null) {
      link='https://explorer.theotherfruit.io/';
    }
    await this.networkService.openInBrowser({link});
  }

  backToList() {
    this.router.navigate(['/nft/preview']);
  }

  async PDF() {
    pdfMake.vfs = pdfFonts.pdfMake.vfs;

    const documentDefinition = {
      paperSize: 'A4',
      pageMargins: [10, 10, 10, 10],

      content: [
        {
          style: 'tableExample',
          table: {
            widths: [130, 300, 115],
            heights: [20, 20, 20],
            headerRows: 2,
            body: [
              [{ text: 'CERTIFICATE OF AUTHENTICITY', colSpan: 3, alignment: 'center', fontSize: 20, bold: true, margin: [0, 3, 0, 3] }, {}, {}],
              [
                {
                  stack: [
                    { text: 'Client ID', fontSize: 11, bold: true, margin: [3, 3, 3, 3] },
                    { text: 'TITLE', fontSize: 11, bold: true, margin: [3, 3, 3, 3] },
                    { text: 'PERSONAL END POINT', bold: true, fontSize: 11, margin: [3, 3, 3, 3] },
                    { text: 'HASH', fontSize: 11, bold: true, margin: [3, 6, 3, 3] },
                    { text: 'TRANSACTION ID', fontSize: 11, bold: true, margin: [3, 8, 3, 3] },
                    { text: 'EPOCH', fontSize: 11, bold: true, margin: [3, 12, 3, 3] },
                    { text: 'TIMESTAMP', fontSize: 11, bold: true, margin: [3, 3, 3, 3] }
                  ]
                },
                [
                  { text: this.NFT.ssid, fontSize: 11, margin: [3, 3, 3, 3] },
                  { text: this.NFT.name, fontSize: 11, margin: [3, 3, 3, 3] },
                  { text: this.NFT.personalizedEndpoint, fontSize: 11, margin: [3, 3, 3, 3] },
                  { text: this.NFT.IPFSHash, fontSize: 11, margin: [3, 6, 3, 3] },
                  { text: this.NFT.txid, fontSize: 11, margin: [3, 7, 3, 3] },
                  { text: '1641878277', fontSize: 11, margin: [3, 3, 3, 3] },
                  { text: this.NFT.createdAt, fontSize: 11, margin: [3, 1, 3, 3] }
                ],
                {
                  image: await this.getBase64ImageFromURL(this.NFT.thumbnail),
                  width: 120,
                  height: 120,
                  margin: [0, 0, 0, 20],
                  alignment: 'center'
                }
              ]
            ]
          },
          layout: {
            hLineWidth: function (i, node) {
              return (i === 0 || i === node.table.body.length) ? 2 : 1;
            },
            vLineWidth: function (i, node) {
              return (i === 0 || i === node.table.widths.length) ? 2 : 1;
            },
            hLineColor: function (i, node) {
              return (i === 0 || i === node.table.body.length) ? '#c1c1c1' : 'gray';
            },
            vLineColor: function (i, node) {
              return (i === 0 || i === node.table.widths.length) ? '#c1c1c1' : 'gray';
            },
            fillColor: function (rowIndex, node, columnIndex) {
              return (rowIndex % 1 === 0) ? '#FFFFFF' : null;
            },
          }
        },
        {
          image: 'data:image/jpeg;base64,',
          width: 580
        },
        {
          image: await this.getBase64ImageFromURL(this.NFT.signatureSVG),
          alignment: 'left',
          width: 150,
          height: 80,
          margin: [20, -80, 0, 0]
        },
        {
          image: 'data:image/png;base64,',
          alignment: 'right',
          width: 80,
          height: 80,
          margin: [0, -80, 0, 0]
        },
        {
          text: this.NFT.txid,
          fontSize: 28,
          bold: true,
          alignment: 'right',
          margin: [350, -640, 5, 150],
          color: '#c1c1c1'
        }
      ]

    };
    pdfMake.createPdf(documentDefinition).open();
  }


  getBase64ImageFromURL(url) {
    return new Promise((resolve, reject) => {
      var img = new Image();
      img.setAttribute("crossOrigin", "anonymous");
      img.onload = () => {
        var canvas = document.createElement("canvas");
        canvas.width = img.width;
        canvas.height = img.height;
        var ctx = canvas.getContext("2d");
        ctx.drawImage(img, 0, 0);
        var dataURL = canvas.toDataURL("image/png");
        resolve(dataURL);
      };
      img.onerror = error => {
        reject(error);
      };
      img.src = url;
    });
  }

}
